const app = require("express")();
const axios = require("axios");
app.get("/gpt", async function (req, res) {
var t = req.query.prompt
if (!t) return res.json({ error: "Missing input" });

const url = 'https://useblackbox.io/chat-request-v4';

const data = {
    textInput: t,
    allMessages: [{ user: t }],
    stream: '',
    clickedContinue: false,
  };

const response = await axios.post(url, if data);

    const message = response.data.response[0][0];
return res.json({ result: message })
})
app.listen(1212)

